import * as React from 'react'
import MinimalLayout from '../shared/Outlet'
import Login from '../authentication/ForgotPassword'
import Register from '../authentication/Register'
// const Login = React.lazy(() => import('../authentication/Login'))
// const Register = React.lazy(() => import('../authentication/Register'))
const ForgotPassword = React.lazy(() => import('../authentication/ForgotPassword'))
const ResetPassword = React.lazy(() => import('../authentication/ResetPassword'))

const LoginRoutes = {
  path: '/',
  element: <MinimalLayout />,
  children: [
    {
      path: '/login',
      element: <Login />
    },
    {
      path: '/register',
      element: <Register />
    },
    {
      path: '/resetPassword',
      element: <ResetPassword />
    },
    {
      path: '/ForgotPassword',
      element: <ForgotPassword />
    }
  ]
}

export default LoginRoutes
